export shellHook=$'# Add additional folders to to XDG_DATA_DIRS if they exists, which will get sourced by bash-completion\nfor p in ${packages}; do\n  if [ -d "$p/share/bash-completion" ]; then\n    XDG_DATA_DIRS="$XDG_DATA_DIRS:$p/share"\n  fi\ndone\n\nsource /nix/store/p0rnzvjims8hawvplyrl2yrviw6ya92l-bash-completion-2.14.0/etc/profile.d/bash_completion.sh\nexport PATH=/nix/store/qqbfqinqxl4v49cv8fpz99c5wlf9gnbn-pre-commit-3.7.1/bin:$PATH\nif ! type -t git >/dev/null; then\n  # This happens in pure shells, including lorri\n  echo 1>&2 "WARNING: git-hooks.nix: git command not found; skipping installation."\nelif ! /nix/store/zlkbk9a9l6jw9ghaknlyk6l73q263m44-git-2.45.2/bin/git rev-parse --git-dir &> /dev/null; then\n  echo 1>&2 "WARNING: git-hooks.nix: .git not found; skipping installation."\nelse\n  GIT_WC=`/nix/store/zlkbk9a9l6jw9ghaknlyk6l73q263m44-git-2.45.2/bin/git rev-parse --show-toplevel`\n\n  # These update procedures compare before they write, to avoid\n  # filesystem churn. This improves performance with watch tools like lorri\n  # and prevents installation loops by lorri.\n\n  if ! readlink "${GIT_WC}/.pre-commit-config.yaml" >/dev/null \\\n    || [[ $(readlink "${GIT_WC}/.pre-commit-config.yaml") != /nix/store/22g9s3vry15hccmwk6w41cj3izkahsnr-pre-commit-config.json ]]; then\n    echo 1>&2 "git-hooks.nix: updating $PWD repo"\n    [ -L .pre-commit-config.yaml ] && unlink .pre-commit-config.yaml\n\n    if [ -e "${GIT_WC}/.pre-commit-config.yaml" ]; then\n      echo 1>&2 "git-hooks.nix: WARNING: Refusing to install because of pre-existing .pre-commit-config.yaml"\n      echo 1>&2 "    1. Translate .pre-commit-config.yaml contents to the new syntax in your Nix file"\n      echo 1>&2 "        see https://github.com/cachix/git-hooks.nix#getting-started"\n      echo 1>&2 "    2. remove .pre-commit-config.yaml"\n      echo 1>&2 "    3. add .pre-commit-config.yaml to .gitignore"\n    else\n      if true; then\n        nix-store --add-root "${GIT_WC}/.pre-commit-config.yaml" --indirect --realise /nix/store/22g9s3vry15hccmwk6w41cj3izkahsnr-pre-commit-config.json\n      else\n        ln -fs /nix/store/22g9s3vry15hccmwk6w41cj3izkahsnr-pre-commit-config.json "${GIT_WC}/.pre-commit-config.yaml"\n      fi\n      # Remove any previously installed hooks (since pre-commit itself has no convergent design)\n      hooks="commit-msg post-checkout post-commit post-merge post-rewrite pre-commit pre-merge-commit pre-push pre-rebase prepare-commit-msg"\n      for hook in $hooks; do\n        pre-commit uninstall -t $hook\n      done\n      /nix/store/zlkbk9a9l6jw9ghaknlyk6l73q263m44-git-2.45.2/bin/git config --local core.hooksPath ""\n      # Add hooks for configured stages (only) ...\n      if [ ! -z "commit commit-msg" ]; then\n        for stage in commit commit-msg; do\n          case $stage in\n            manual)\n              ;;\n            # if you amend these switches please also review $hooks above\n            commit | merge-commit | push)\n              stage="pre-"$stage\n              pre-commit install -t $stage\n              ;;\n            commit-msg|post-checkout|post-commit|post-merge|post-rewrite|pre-commit|pre-merge-commit|pre-push|pre-rebase|prepare-commit-msg|manual)\n              pre-commit install -t $stage\n              ;;\n            *)\n              echo 1>&2 "ERROR: git-hooks.nix: either $stage is not a valid stage or git-hooks.nix doesn\'t yet support it."\n              exit 1\n              ;;\n          esac\n        done\n      # ... or default \'pre-commit\' hook\n      else\n        pre-commit install\n      fi\n\n      # Fetch the absolute path to the git common directory. This will normally point to $GIT_WC/.git.\n      common_dir=$(/nix/store/zlkbk9a9l6jw9ghaknlyk6l73q263m44-git-2.45.2/bin/git rev-parse --path-format=absolute --git-common-dir)\n\n      # Convert the absolute path to a path relative to the toplevel working directory.\n      common_dir=${common_dir#$GIT_WC/}\n\n      /nix/store/zlkbk9a9l6jw9ghaknlyk6l73q263m44-git-2.45.2/bin/git config --local core.hooksPath "$common_dir/hooks"\n    fi\n  fi\nfi\n\nln -sfn /nix/store/c6h2p42qd6say2j9vyxxpkz0gmikpvl0-ansible.cfg ansible.cfg\n'
